import { TopNav,Footer,Breadcrumbs} from "govuk-react";
import HomePage from "./Pages/HomePage";
import viewAppointment from "./Pages/Admin/viewAppointment";
import { Link, Route,Routes } from "react-router-dom";
function App() {
  return (
   <div>
    <TopNav>
<Link to="/" style={{color:"white" }}>Home Page</Link>
<Link to="viewAppointment"style={{color:"white" }}>View Admin viewAppointment</Link>
    </TopNav>


<Routes>
  <Route path="/" element={<HomePage/> }/>
  <Route path="viewAppointment" element={<viewAppointment/>}/>
</Routes>
    <Footer>

    </Footer>
  </div>
  );
}

export default App;
